                  Lake Kachess Rd\",\"FacilityStreetAddress2\":\"\",\"FacilityStreetAddress3\":\"\",\"LastUpdatedDate\":\"2023-01-10\",\"PostalCode\":\"98925\"}],\"FacilityAdaAccess\":\"N\",\"FacilityDescription\":\"<h2>Overview</h2>\\nKachess
                  Campground sits just off the forested northwest shore of Kachess Lake in Okanogan-Wenatchee
                  National Forest.<br/><br/> \\n\\nSet in dense old-growth conifer forest and
                  surrounded by high mountains, Kachess Campground is considered one of the
                  most beautiful sites in the Cle Elum Ranger District.<h2>Recreation</h2>\\n<p>Kachess
                  is a prime location for  fishing, swimming, boating, paddling and mountain
                  biking in summer and early fall.\_\_</p>\\n<p>The campground is also a great
                  base camp for day-hikers and overnight backpackers. Several access trails
                  from the area give hikers the chance to create their own excursions, whether
                  it be a day hike or an overnight trip.  <br><br>Starting at the campground,
                  the Kachess Lake Trail is a short loop next to the lake, enjoyable for hikers
                  of all levels.   <br><br>Anglers enjoy fishing for rainbow trout, cutthroat
                  trout and kokanee salmon from boat or shoreline.  Box Canyon Creek is closed
                  to all fishing from the mouth, 2-miles up to the falls. Check current WDFW
                  fishing regulations for additional restrictions.</p>\\n<h2>Facilities</h2>\\nKachess
                  Lake Campground offers 150 sites that accommodate both tent and RV camping,
                  including one designated group site that can accommodate up to 50 guests.
                  \ The group site and 106 single family sites are available for reservation,
                  and the rest are available on a first-come first-serve basis. \\nSites are
                  equipped with picnic tables, campfire rings with grills, vault toilets. Drinking
                  water is available. There are no electric hookups.   \\nOne motorized boat
                  launch, one non-motorized boat launch, a swimming area and picnic areas are
                  also available to visitors.<h2>Natural Features</h2>\\nTowering peaks, high-country
                  lakes and old-growth forests provide visitors with a variety of landscapes.
                  \  \\n\\nKachess Lake, adjacent to the campground, is a reservoir that stores
                  and provides water for irrigation for south-central Washington.    \\n\\nThe
                  surrounding undeveloped wilderness, clean streams and diverse forests support
                  an abundance of wildlife, including deer, porcupine, native fish and migratory
                  birds.\\n<h2>contact_info</h2>\\nThis location has limited staffing. Please
                  call (661) 702-1420 for general information.\\n<h2>Nearby Attractions</h2>\\n<p>The
                  spectacular Pacific Crest Trail (PCT) can be accessed near the campground.
                  One of the world's premier National Scenic Trails, it showcases some of North
                  America's most fantastic scenery as it winds its way from Mexico to Canada
                  through California, Oregon and Washington.</p>\\n<h2>Charges & Cancellations</h2>\\n<p>Cancellations</p>\\n<p>Individual
                  Campsites: Cancellations up to 2 days before a reservation start date incur
                  a $10.00 cancellation fee.\_</p>\\n\\n<p>A visitor who cancels a reservation
                  the day before or on the day of arrival will pay a $10.00 service fee AND
                  forfeit the first night's use fee including tax and applicable add-on for
                  a campsite.</p>\\n\\n<p>Cancellations for a one-night reservation will forfeit
                  the entire amount paid and will not be subject to an additional service fee.</p>\\n\\n<p>Group
                  Sites</p>\\n<p>Group Facility (including Cabins and Lookouts): A visitor who
                  cancels a group overnight facility reservation less than 14 days before the
                  arrival date will pay a $10.00 service fee AND forfeit the first night's use
                  fee.</p>\\n\\n<p>No-Shows</p>\\n<p>A no-show visitor is one who does not arrive
                  at a campground and does not cancel the reservation by check-out time on the
                  day after the scheduled arrival date. Staff will hold a campsite until check-out
                  time on the day following the arrival date.</p>\\n\\n<p>No-shows are assessed
                  $20.00 service fee and forfeit the first night's rate, taxes and applicable
                  add-on for a campsite.\_\_</p>\\n\\n<p>Refunds</p>\\n<p>Visitors may submit
                  a refund request through their Recreation.gov profile within 7 days of the
                  end date of their reservation. Refunds will not be issued after the 7 days
                  has ended.</p>\\n\\n<p>Refunds for debit or credit card payments will be issued
                  as a credit to the original bank or credit card used to pay.</p>\\n\\n<p>For
                  check or cash purchases, Recreation.gov will mail a Treasury check for refunds
                  of cash, check, or money order payments to the address associated with the
                  reservation. Treasury check refunds may take up to 6-8 weeks to arrive.\_</p>\\n\\n<p>In
                  the event of an emergency closure, the Recreation.gov team or facility manager
                  will refund all fees and will attempt to notify you using the contact information
                  within the Recreation.gov visitor profile.</p>\\n\\n\\n\",\"FacilityDirections\":\"From
                  Seattle trave east on I-90 approximately 62 miles, or from Cle Elum travel
                  west on I-90 approximately 20 miles.  Take exit 62  and follow Kachess Lake
                  Road for 5.5 miles to the campground, which is on the right. \",\"FacilityEmail\":\"briandspeeg@fs.fed.us\",\"FacilityID\":\"232064\",\"FacilityLatitude\":47.35484,\"FacilityLongitude\":-121.24342,\"FacilityMapURL\":\"\",\"FacilityName\":\"KACHESS\",\"FacilityPhone\":\"509-852-1100\",\"FacilityReservationURL\":\"\",\"FacilityTypeDescription\":\"Campground\",\"FacilityUseFeeDescription\":\"<p>Extra
